import { Button, Grid, Stack, IconButton, Typography } from "@mui/material";
import ThumbUpAltOutlinedIcon from "@mui/icons-material/ThumbUpAltOutlined";
import ThumbDownAltOutlinedIcon from "@mui/icons-material/ThumbDownAltOutlined";
import BookmarkBorderOutlinedIcon from "@mui/icons-material/BookmarkBorderOutlined";
import ShareRoundedIcon from "@mui/icons-material/ShareRounded";
import ChatRoundedIcon from "@mui/icons-material/ChatRounded";
import AccountCircleRoundedIcon from '@mui/icons-material/AccountCircleRounded';

export const Content = () => {
  return (
    <Grid
      container
      justifyContent={"center"}
      alignItems={"center"}
      sx={{ width: "50%", height: "50%" }}
    >
      <Grid item md={12}>
        <Typography variant="body" component="p" color={"#fff"}>
          It's not Mr. Strange, not Master Strange. It's Doctor Strange! When I
          became a doctor, I swore to do no harm.
        </Typography>
      </Grid>
      <Grid item md={12}>
        <Stack direction={"row"} justifyContent={"space-around"}>
          <Button startIcon={<ThumbUpAltOutlinedIcon />}>{"5M"}</Button>
          <Button startIcon={<ThumbDownAltOutlinedIcon />}>{"1M"}</Button>
          <IconButton color="primary">
            <ChatRoundedIcon />
          </IconButton>
          <IconButton color="primary">
            <ShareRoundedIcon />
          </IconButton>
          <IconButton color="primary">
            <BookmarkBorderOutlinedIcon />
          </IconButton>
        </Stack>
      </Grid>
    </Grid>
  );
};
